svg.script:
// move the background

// configuration

var returnBackgroundToStartAfterRepetitions = 3;
var backgroundX = 0;
var backgroundVelocity = -1;

// variables to initialize
var backgroundWasInitialized = false;
var backgroundWidth = null;
var backgroundWidthElement = null;
var backgroundInitialTranslation = null;

function initializeBackground() {
    if (backgroundWasInitialized) {
        return;
    }
    backgroundWasInitialized = true;
    backgroundWidthElement = document.getElementById('backgroundWidth');
    backgroundWidth = backgroundWidthElement.getBBox().width;
    var backgroundlayer = layerNamed('background');
    backgroundInitialTranslation = backgroundlayer.getAttribute('transform');
}

function moveBackground() {
    initializeBackground();

    backgroundX += backgroundVelocity;
    var maximumX = returnBackgroundToStartAfterRepetitions * backgroundWidth;
    var direction = Math.sign(backgroundVelocity);
    if (backgroundX * direction > maximumX) {
        backgroundX -= maximumX * direction;
    }

    var bg = layerNamed("background");

    // set the position according to 
    //    http://stackoverflow.com/questions/15254659/a-generic-js-function-to-move-any-svg-element
    bg.setAttribute('transform', backgroundInitialTranslation + ',translate(' + backgroundX + '0)');
}

var movingBackgoundIntervalID = null;

function startMovingBackgound() {
    if (movingBackgoundIntervalID == null) {
         movingBackgoundIntervalID = setInterval(moveBackground, 50);
    }
}

function stopMovingBackgound() {
    if (movingBackgoundIntervalID != null) {
         clearInterval(movingBackgoundIntervalID);
    }
}

// debug help

function getDebugElement() {
    return document.getElementById('debugString');
}

function setDebugString(string) {
    getDebugElement().textContent = string;
}

// scale the game so it always fits the screen
// This way the zoom is not activated on tablets and phones

function scale_to_fullscreen() {
    // compute scales
    var svg = document.getElementsByTagName("svg")[0];

    var width = svg.getAttribute('width');
    var height = svg.getAttribute('height');

    // window height and width
    //    http://stackoverflow.com/questions/6850164/get-the-device-width-in-javascript
    var window_width = (window.innerWidth > 0) ? window.innerWidth : screen.width;
    var window_height = (window.innerHeight > 0) ? window.innerHeight : screen.height;

    var scale_width = window_width / width;
    var scale_height = window_height / height;

    // choose smallest scale
    //    http://www.w3schools.com/jsref/jsref_min.asp
    var scale = Math.min(scale_height, scale_width);

    // set the dimensions
    svg.setAttribute('width', width * scale);
    svg.setAttribute('height', height * scale);
}

// some functions that are useful

function layerNamed(name) {
    var layers = document.getElementsByTagName("g");
    for (var i = 0; i < layers.length; i++) {
        var layer = layers[i];
        if (layer.getAttribute('inkscape:groupmode') == 'layer') {
            var label = layer.getAttribute('inkscape:label');
            if (label != null && label.toLowerCase() == name.toLowerCase()) {
                return layer;
            }
        }
    }
    alert('Error: getLayerNamed: Can not find a layer named "' + name + '". You should debug!');
    return null;
}

// startGame

function startGame() {
    layerNamed('startscreen').style.display = 'none'; // none = hide layer
    layerNamed('bird').style.display = 'inline'; // inline = show layer
    layerNamed('background').style.display = 'inline'; // inline = show layer
    startFlapping();
}

// startGame

function showStartScreen() {
    layerNamed('startscreen').style.display = 'inline'; // none = hide layer
    layerNamed('bird').style.display = 'none'; // inline = show layer
    layerNamed('background').style.display = 'inline'; // inline = show layer
    startFlapping();
}

// setInterval http://www.w3schools.com/jsref/met_win_setinterval.asp
var flappingIntervalID = null;

function startFlapping() {
    if (flappingIntervalID == null) {
         flappingIntervalID = setInterval(fly, 50);
    }
    y = 0;
    velocity = 0;
}

function stopFlapping() {
    if (flappingIntervalID != null) {
         clearInterval(flappingIntervalID);
    }
}

var gravity = 1.8;
var velocity = 0;
var y = 0;
var flap_velocity = -18;

var bottom = 250;
var top = -bottom; // suppose we are in the middle

function fly() {
    var bird = layerNamed("bird");
    velocity += gravity;
    y += velocity;
    if (y > bottom) {
        y = bottom;
    }
    // set the position according to 
    //    http://stackoverflow.com/questions/15254659/a-generic-js-function-to-move-any-svg-element
    bird.setAttribute("transform", "translate(0," + y + ")");
}

function flap() { 
    velocity = flap_velocity;
}

// set mouse down according to 
//    http://stackoverflow.com/questions/322378/javascript-check-if-mouse-button-down
var svg = document.getElementsByTagName("svg")[0];
svg.onmousedown = flap;
svg.touchend = flap;

// Execute everything that should be started.
// This script must be the last script. Otherwise not all functions may be loaded.

window.onload = function() {
    startFlapping();
    scale_to_fullscreen();
    startMovingBackgound();
    showStartScreen();
}
